import React from 'react';
import alina from 'assets/img/logo/alina.png';
import logoArquivo from 'assets/img/logo/arquivo.png';
import logoPaper from 'assets/img/logo/paper.png';
import logoCode from 'assets/img/logo/code.png';
import logoDatabase from 'assets/img/logo/database.jpg';
import Box from '@mui/material/Box';
import Button from '@mui/material/Button';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import CssBaseline from '@mui/material/CssBaseline';
import Grid from '@mui/material/Grid';
import Typography from 'components/Typography';
import Container from '@mui/material/Container';
import Page from 'components/Page';
import 'styles/components/_sources.scss';
import FadeIn from 'components/FadeIn';

import {
  CardImg,
} from 'reactstrap';
import Row from 'reactstrap/lib/Row';


function Copyright(props) {
  return (
    <Typography className="font" style={{color:"white", borderWidth:"350px", borderColor:"white", fontWeight:"600"}} variant="body2" align="center" {...props}>
      {'Copyright © 2022   Implementado na  '}
      <a className="font" style={{color:"green", fontWeight:"600"}} target="_blank" href="https://www.ua.pt">Universidade de Aveiro</a>
    </Typography>
  );
}

const tiers = [
  {
    title: 'Projeto',
    image: logoCode,
    description: [
      'Código-aberto do projeto',
    ],
    buttonText:  <a target="_blank" className="buttonText" href="https://www.ua.pt">Aceder ao projeto</a>,
    buttonVariant: 'outlined',
  },
  {
    title: 'Relatório técnico',
    image: logoPaper,
    description: [
      'Relatório técnico do projeto',,
    ],
    buttonText: <a className="buttonText" target="_blank" href="https://www.ua.pt">Aceder ao relatório</a>,
    buttonVariant: 'outlined',
  },
  {
    title: 'Arquivo.pt',
    image: logoArquivo,
    description: [
      'Fonte oficial dos dados',
    ],
    buttonText: <a className="buttonText" target="_blank" href="https://www.arquivo.pt">Aceder ao Arquivo.pt</a>,
    buttonVariant: 'outlined',
  },
  {
    title: 'Base de dados',
    image: logoDatabase,
    description: [
      'Dados manualmente anotados',
    ],
    buttonText: <a className="buttonText" target="_blank" href="https://www.arquivo.pt">Aceder aos dados</a>,
    buttonVariant: 'outlined',
  },

];

const tiers2 = [
  {
    title: 'Alina Yanchuk',
    image: alina,
    description: [
      'Autora',
    ],
    email: "alinayanchuk@ua.pt",
    cargo: 'Mestrado em Engenharia Informática',
  },
  {
    title: 'Alina Trifan',
    image: logoPaper,
    description: [
      'Orientadora',
    ],
    email: "alinayanchuk@ua.pt",
    cargo: 'Investigação',
  },
  {
    title: 'José Oliveira',
    image: logoPaper,
    description: [
      'Orientador',
    ],
    email: "alinayanchuk@ua.pt",
    cargo: 'Professor',
  },
  {
    title: 'Olga Pereira',
    image: logoPaper,
    description: [
      'Orientadora',
    ],
    email: "alinayanchuk@ua.pt",
    cargo: 'Investigação',
  },

];




const SourcesPage = () => {
  return (
    <Page>
    <Row >
    <div style={{backgroundRepeat: 'no-repeat', backgroundImage:'linear-gradient(#ffd639, white)', width:"100%"}}>
      <CssBaseline />
      {/* Hero unit */}
      <FadeIn>
      <p className="authorsTitle">RECURSOS</p>
      </FadeIn> 
      <FadeIn>
      <p className="subheading">
        Os principais recursos e referências referentes a este projeto podem ser encontrados abaixo.
      </p>
      </FadeIn>
      {/* End hero unit */}
      <Container  style={{marginTop:"70px"}}>
        <Grid container spacing={3} alignItems="flex-end">
          {tiers.map((tier) => (
            // Enterprise card is full width at sm breakpoint
            <Grid
            className="font"
              item
              key={tier.title}
              xs={4}
              sm={tier.title === 'Enterprise' ? 12 : 6}
              md={3}
            >
              <FadeIn  delay={450}>
              <Card className='recurso'>
                <p className='fontTitle' style={{fontSize:"21px",textAlign: "center", marginTop:"20px"}}>{tier.title}</p>
                <CardContent>
                  <Box
                    sx={{
                      display: 'flex',
                      justifyContent: 'center',
                      alignItems: 'baseline',
                      mb:2,

                    }}
                  >
                   <CardImg src={tier.image} style={{margin:10}}  />
                  </Box>
                  <p>
                    {tier.description.map((line) => (
                      <p className='font' style={{fontSize:"15px",textAlign: "center", marginTop:"20px"}}>{tier.description}</p>
                    ))}
                  </p>
                </CardContent>
                <CardActions>
                  <Button style={{borderColor:"#f9c74f", borderWidth:"2px"}} fullWidth variant={tier.buttonVariant}>
                    {tier.buttonText}

                  </Button>
                </CardActions>
              </Card>
            </FadeIn>
            </Grid>
          ))}
        </Grid>
      </Container>
      <FadeIn>
      <p style={{marginTop:"100px"}} className="authorsTitle">Contactos</p>
      </FadeIn> 

        <Row style={{marginLeft:"100px"}}>
